INSERT INTO `nb_classes` VALUES (3,'CL','Графика','Легкая внешняя','Дискретная (внешняя) видеокарта начального уровня с собственной видеопамятью\nСерии<ul><li>NVidia MX</li><li>Intel Xe 11</li><li>Radeon R/RX, 500, 600.</li></ul>','CL_discret_lite'),(20,'CL','Процессор','Начального уровня','Самые дешевые и низкопроизводительные процессоры, включая энергосберегающие серерии. \nВ большинстве - ядро процессора Intel Atom (Celeron или Pentium серии N)\n или устаревшие серии процессоров AMD (не Zen).','CL_low_end'),(21,'CL','Графика','Встроенная','Только встроенная (интегрированная) в процессор графика. \nДля храннения грфических данных используется область основной оператитвной памяти.','CL_int'),(22,'CL','Форм-фактор','Трансформер с поворотным экраном','','CL_2_in_1'),(23,'CL','Форм-фактор','Мини до 12\"','','CL_mini'),(24,'CL','Форм-фактор','Компактный 13\"-14\"','','CL_13-14'),(25,'CL','Форм-фактор','Стандартный размер 15\"','','CL_15'),(26,'CL','Форм-фактор','Большой экран 16\" и более','','CL_maxy'),(27,'GO','','Премиальный','Ноутбуки премиальных серий (кроме игровых), топовый дизайн, имидж','GO_premium'),(28,'GO','Коммерческий','Корпоративный','Бизнес-ноутбук топового уровня,  высокая прочность, PRO-компоненты, ср-ва безопасности, имидж','GO_corporate'),(29,'GO','Общее назначение','Для коммуникаций и просмотра','Ноутбуки для потребления контента на энергосбрегающих или удешевленных процессорах.\n А также компактные ноутбуки (ультрабуки) на стандартных процессорах с экраном до 13\" включительно со встроенной графикой','GO_content'),(30,'GO','Общее назначение','Для обычной работы и учебы','Ноутбук для работы и учебы c экраном 14\", 15\" или 17\"\nСтандартный мобильный процессор, встроенная графика\n\nКроме премиальных моделей и трансформеров.','GO_horse_work'),(31,'GO','Общее назначение','Универсальный домашний','Универсальный ноутбук потребительского типа 15\"-17\"\nСтандартный или продвинутый процессор \nГрафика: встроенная, внешня легкая или игровая среднего уровня','GO_universum_home'),(34,'GO','Общее назначение','Профессиональная рабочая станция','Мощная машина для инженерных и дизайнерских задач, профессиональная видеокарта','GO_workstation'),(35,'GO','Коммерческий','Бизнес средний','Стандартные бизнес-ноутбуки, высокая прочность, PRO-компоненты, ср-ва безопасности','GO_smb'),(36,'GO','Коммерческий','Для массовых рабочих мест','Бюджетные бизнес-ноутбуки для массовых рабочих мест и стандартных деловых приложений','GO_bus_essential'),(37,'CL','Графика','Игровая или профессиональная','Видеокарта игрового класса среднего или высокого уровня с собственной видеопамятью большого объема\n Среднего уровня: Nvidia GTX, AMD Rdeon RX\n<strong>Высокого уровня:</strong><ul><li>Nvidia RTX</li><li>AMD Radeon RX6700/6800, RX5700/5600</li></ul>\nПрофессиональные: <ul><li>Nvidia Quadro</li><li>RTX3000/RTX5000</li><li>AMD Radeon Pro</li></ul>','CL_Top'),(38,'GO','Общее назначение','Для творчества или разработки','Нотбук достаточной производительности для задач Content-creation или программирования. \nСтандартный или продвинутый процессор, с внешней графикой. С экраном от 14\" и более.','GO_creation'),(40,'GO','Общее назначение','Игровой','Стандартный или продвинутый процессор, игровая видеокарта среднего или высокого класс Nvidia GTX/RTX или AMD RX','GO_Game'),(45,'CL','Процессор','Стандартный мобильный','Основные семейства процессоров для ноутбуков:\nIntel Core, AMD Ryzen. Модели с индексом U.\nА также ARM-чипы Apple Silicon M1</ul>','CL_std_cpu'),(46,'CL','Процессор','Для продвинутых ноутбуков','Старшие процессоры для ноутбуков:\n Intel Core, AMD Ryzen. Модели с индексом H. \nРассчитаны на использование в моделях с дискретной графикой.','CL_h_cpu'),(47,'GO','','Ультрабук','Компактные ноутбуки с экраном от 12\", 13\" или 14\". \nНе смоторя на габариты - полнофункциональные устройства на базе стандартных мобильных процессоров.','GO_ultrabook');
